import React from 'react'
import {useState} from 'react';
import styled from 'styled-components';
import closeicon from '../../assets/closeicon.png'
export default function Details(props) {
    return (props.trigger) ?(
        <Background>
            <Text><TextDetails>Details</TextDetails>
            <MoNo>Mo.No</MoNo>
            <Occupation>Occupation</Occupation>
            <Location>Location</Location>
            <Achievement>Achievments</Achievement>
            <InputMoNo></InputMoNo>
            <InputLocation></InputLocation>
            <Submit>Submit</Submit>
            <InputOccupation></InputOccupation>
            <InputAchievment ></InputAchievment>
            <Close type="reset" onClick={() => props.setTrigger(false)}></Close>
            </Text>
        </Background>
    ): '';
}
const Background= styled.div
`
position: absolute;
width: 601px;
height: 484px;
top: 200px;
left:500px;
background: #FAF8F9;
box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
`
const Text= styled.div
`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 24px;
/* identical to box height */


color: #000000;
`
const TextDetails= styled.div
`
position: absolute;
top: 42px;
left: 273px;
`
const MoNo= styled.div
`
position: absolute;
top: 112px;
left: 88px;
`
const Occupation= styled.div
`
position: absolute;
top: 164px;
left: 88px;

`
const Submit= styled.button
`
position: absolute;
top: 393px;
left: 273px;
width: 144px;
height: 24.13px;
background: #16A13A;
text-align: center;
color: white;
border-radius: 12.4675px;
`
const Close= styled.div
`
position: absolute;
width: 54px;
height: 54px;
left: 547px;
background-image: url(${closeicon});
top: 0px;

`
const Location= styled.div
`
position: absolute;
top: 218px;
left: 88px;
`
const Achievement= styled.div
`
position: absolute;
top: 270px;
left: 88px;

`
const InputMoNo= styled.input
`
width: 235px;
height: 24px;
position: absolute;
background: #FFFFFF;
border: 1px solid #000000;
box-sizing: border-box;
top: 112px;
left: 235px;
`
const InputLocation= styled.input
`
width: 235px;
height: 24px;
position: absolute;
background: #FFFFFF;
border: 1px solid #000000;
box-sizing: border-box;
top: 164px;
left: 235px;
`
const InputOccupation= styled.input
`
width: 235px;
height: 24px;
position: absolute;
background: #FFFFFF;
border: 1px solid #000000;
box-sizing: border-box;
top: 218px;
left: 235px;
`
const InputAchievment= styled.input
`
width: 235px;
height: 77px;
position: absolute;
background: #FFFFFF;
border: 1px solid #000000;
box-sizing: border-box;
top: 270px;
left: 235px;
`
